import React, { Component } from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { I18nextProvider } from "react-i18next";
import i18next from "i18next";

import store from "./../store/react-redx-store";
import FarmerAccounts from "./client/route";

i18next.init({
  interpolation: { escapeValue: false }, // React already does escaping
  lng: "th", // language to use
  resources: {
    en: {
      translation: {
        welcome: "hello world",
        sidemenu: {
          "dashboard": "డాష్బోర్డ్",
          "myWallet": "My Wallet",
          "helpCenter": "Help Center",
          "calendar": "Calendar",
          "myDay": "My Day",
          "cropCalendar": "Crop Calendar",
          "phoneBook": "Phone Book",
          "assets": "Assets",
          "noAssetsRegistered": "No Assets Registered",
          "learnings": "Learnings",
          "videos": "Videos",
          "blog": "Blog",
          "farmingCalculator": "Farming Calculator",
        },
      },
    },
    th: {
      translation: {
        sidemenu: {
          "dashboard": "డాష్బోర్డ్",
          "myWallet": "నా పర్సు",
          "helpCenter": "సహాయ కేంద్రం",
          "calendar": "క్యాలెండర్",
          "myDay": "నా రోజు",
          "cropCalendar": "పంట క్యాలెండర్",
          "phoneBook": "ఫోన్ బుక్",
          "assets": "ఆస్తులు",
          "noAssetsRegistered": "ఆస్తులు నమోదు కాలేదు",
          "learnings": "అభ్యాసాలు",
          "videos": "వీడియోలు",
          "blog": "బ్లాగ్",
          "farmingCalculator": "వ్యవసాయ కాలిక్యులేటర్",
        },
      },
    },
  },
});

export default function App() {
  return (
    <React.Fragment>
      {process &&
        process.browser &&
        ReactDOM.render(
          <Provider store={store}>
            <I18nextProvider i18n={i18next}>
              <FarmerAccounts />
            </I18nextProvider>
          </Provider>,
          document.getElementById("root")
        )}
    </React.Fragment>
  );
}
